import React from 'react';
import {
  AppBar,
  Container,
  Toolbar, 
  Menu,
  MenuItem, 
  Typography
} from '@mui/material';

const pages = ['About', 'Work', 'Contact'];

const NavBar = () => {
  return (
    <AppBar 
      position="static"
      elevation={5}
      sx={{
        height: '7rem',
        // background: 'rgb(121,171,189)',
        background: 'radial-gradient(circle, rgba(121,171,189,1) 0%, rgba(42,33,110,1) 100%)',
        margin: '.5rem',
        maxWidth: 1000,
        mx: 'auto',
        borderRadius: 1
      }}
    >
      <Container>
        <Toolbar>
          <Menu open={true}>
            {pages.map((page) => (
                <MenuItem key={page}>
                  <Typography
                    variant="subtitle1" 
                    textAlign="center"
                    // sx={{
                    //   fontSize : '2rem'
                    // }}
                  >
                    {page}
                  </Typography>
                </MenuItem>
              ))}
          </Menu>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default NavBar;
